import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom'; 
import AppState from './context/appState';
import Routes from './Routes';

function App() {
  return (
  	<AppState>
	    <Router>
	      	<Bar />
	      	<div className="main">
		      	<MenuBar />
		      	<div className="wallpaper">
			    	<Routes />
				</div>
			</div>
	    </Router>
    </AppState>
  );
}

export default App;
